import React, { Component } from "react";
const saveUser = require('./../../../service/api');

export default class SignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      identification: '',
      username: "",
      email: "",
      password: "",
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({value: event.target.value});
  }

  handleSubmit(e) {
    e.preventDefault();
    const {identification, username, email, password } = this.state;

    console.log(e.target.form.value)

    // console.log(identification, username, email, password);
